import React from 'react';
import Navbar from './components/Navbar';
import HomeSection from './components/HomeSection';
import AboutSection from './components/AboutSection';
import ExperienceSection from './components/ExperienceSection';
import ProjectsSection from './components/ProjectsSection';
import ParallaxBackground from './components/ParallaxBackground'; // Make sure to import the ParallaxBackground component

function App() {
  return (
    <div>
      <Navbar />
      <ParallaxBackground>
        <div id="home" className="section"><HomeSection /></div>
      </ParallaxBackground>
      <ParallaxBackground>
        <div id="about" className="section"><AboutSection /></div>
      </ParallaxBackground>
      <ParallaxBackground>
        <div id="experience" className="section"><ExperienceSection /></div>
      </ParallaxBackground>
      <ParallaxBackground>
        <div id="projects" className="section"><ProjectsSection /></div>
      </ParallaxBackground>
    </div>
  );
}

export default App;
